import styled from "styled-components";
export const Button = styled.button`
  width: 100%;
  padding: 0.5em 0em;
  display: flex;
  justify-content: center;
  align-items: center;
  border: none;
  outline: none;
  color: ${({ theme }) => theme.colors.white1};
  background: ${({ theme }) => theme.colors.greenSky1};
`;
